INSERT INTO `wp_posts` VALUES (5,1,'2016-10-01 17:12:52','2016-10-01 17:12:52','','pahadi-dagdiya-logo','','inherit','open','closed','','pahadi-dagdiya-logo','','','2016-10-01 17:13:16','2016-10-01 17:13:16','',0,'http://localhost/wp-content/uploads/2016/10/Pahadi-Dagdiya-logo.png',0,'attachment','image/png',0),(6,1,'2016-10-01 17:54:18','2016-10-01 17:54:18','[gallery ids=\"645,644,632,630,633,635,637,642,643\"]\r\n\r\n<center><b>ʺHe who opens a school door, closes a prison.ʺ – Victor Hugo</b></center>\r\nPahadi Dagdya - friend from the Hills, is opening that school door for all the economically deprived children of Uttarakhand . It was started by 4 friends as a voluntary effort and now has joined by 127 other friends. Pahadi Dagdya, so far has reached out 93 children of 13 schools of Pauri and Tehri Garhwal by providing them with fees, bags, books and uniforms.\r\n\r\nDoubtless, education is the most powerful catalyst for social transformation. But child education cannot be done in isolation. A child will go to school only if the family income is good. Realizing this, Pahadi Dagdya, beginning in the corridors of education, adopted a lifecycle approach of development by providing the child with financial aid so that he or she can come to school.\r\n\r\nThis poverty damages childhood with significant effects on a child’s physical and mental health, as well as educational achievement. It limits the expectations of the child’s ability to perform well in school,. For this reason, Pahadi Dagdya also identifies and encourages the dropouts to continue their education.\r\n\r\nThe poor and underprivileged kids lag at all stages of education. When earning a livelihood and taking care of the members of the family becomes a primary matter of concern in one’s life, education stands a little or, very often, no chance of pursuance. For many underprivileged children education is a high-priced luxury, So, Pahadi dagdya took an initiative for providing assistance to these kids. It has already helped 93 such kids.\r\n\r\nIt believes that unless members of the civil society are involved proactively in the process of development, sustainable change will not happen. Following this model of Civic Driven Change, Pahadi Dagdya sensitizes and engages the civil society by holding valuable meetings wherever and whenever possible on important issues.\r\nIt is also equipped with its own newsletter which can elaborate upon the news related to its latest achievement, ongoing work and future projects. Moreover, Pahadi Dagdya is gathering attention over social platforms as it actively shares the eye catching and important information regarding Uttarakhand and their people which is liked by many.\r\nToday, 8 million children in India are out of school – surrounded by poverty and despair; they are fighting a daily battle for their education. Pahadi Dagdya wants to bring hope in their lives. So let’s be together and bring a change and make it last.','We Support Child Education','','publish','closed','closed','','welcome-to-pahadi-dagrya-group','','','2017-05-14 21:36:38','2017-05-14 16:06:38','',0,'http://localhost/?page_id=6',0,'page','',0),(7,1,'2016-10-01 17:54:18','2016-10-01 17:54:18','<p class=\"pad_bot2\"><strong>At vero eos et accusamus et iusto odio dignissimos ducimus qui blanditiis praesentium voluptatum deleniti atque corrupti quos dolores et quas molestias excepturi sint occaecati cupiditate non provident, similique sunt in culpa.</strong></p>\r\n<p style=\"text-align: left;\">Et harum quidem rerum facilis est et expedita distinctio. Nam libero tempore, cum soluta nobis est eligendi optio cumque nihil impedit quo minus id quod maxime placeat facere possimus, omnis voluptas assumenda est, omnis dolor repellendus. Temporibus autem quibusdam et aut officiis debitis aut rerum necessitatibus saepe eveniet ut et voluptates repudiandae sint et molestiae non recusandae. Itaque earum rerum hic tenetur a sapiente delectus, ut aut reiciendis.</p>','Welcome to Pahadi Dagrya group','','inherit','closed','closed','','6-revision-v1','','','2016-10-01 17:54:18','2016-10-01 17:54:18','',6,'http://localhost/2016/10/01/6-revision-v1/',0,'revision','',0),(8,1,'2016-10-01 18:01:08','2016-10-01 18:01:08','','HOME','','publish','closed','closed','','8','','','2017-03-18 15:40:44','2017-03-18 10:10:44','',0,'http://localhost/?p=8',1,'nav_menu_item','',0),(11,1,'2016-10-01 18:14:14','2016-10-01 18:14:14','','fake_brick','','inherit','open','closed','','fake_brick','','','2016-10-01 18:14:14','2016-10-01 18:14:14','',0,'http://localhost/wp-content/uploads/2016/10/fake_brick-1.png',0,'attachment','image/png',0),(12,1,'2016-10-01 18:21:11','2016-10-01 18:21:11','','cork_1','','inherit','open','closed','','cork_1','','','2016-10-01 18:21:11','2016-10-01 18:21:11','',0,'http://localhost/wp-content/uploads/2016/10/cork_1.png',0,'attachment','image/png',0),(13,1,'2016-10-01 18:23:27','2016-10-01 18:23:27','','leather_1','','inherit','open','closed','','leather_1','','','2016-10-01 18:23:27','2016-10-01 18:23:27','',0,'http://localhost/wp-content/uploads/2016/10/leather_1.png',0,'attachment','image/png',0),(14,1,'2016-10-01 19:11:11','2016-10-01 19:11:11','','header_image','','inherit','open','closed','','header_image','','','2016-10-01 19:11:11','2016-10-01 19:11:11','',0,'http://localhost/wp-content/uploads/2016/10/header_image.jpg',0,'attachment','image/jpeg',0),(15,1,'2016-10-01 19:14:17','2016-10-01 19:14:17','','header_image','','inherit','open','closed','','header_image-2','','','2016-10-01 19:14:17','2016-10-01 19:14:17','',0,'http://localhost/wp-content/uploads/2016/10/header_image-1.jpg',0,'attachment','image/jpeg',0),(16,1,'2016-10-01 19:42:46','2016-10-01 19:42:46','We believe that education is the key to the development of any child, region and country. To enssure that Uttarakhand\'s educational aspirations are met we at Pahadi Dagdya work tirelessly towards:\r\n1. Providing all support to aide education amongst kids of all age groups in Uttarakhand. We do this by providing them with Fees, Bags, Books, Uniforms amongst other tools required for pursuing education at school.\r\n2. Providing financial aid to kids who are economically deprived and are not being able to pursue education as a result.\r\n3. Identifying school drop outs, motivating them and ensuring their re-admission in school.','Our Mission','','publish','closed','closed','','our-mission','','','2016-10-17 17:32:36','2016-10-17 17:32:36','',0,'http://localhost/?page_id=16',0,'page','',0),(17,1,'2016-10-01 19:37:55','2016-10-01 19:37:55','','13612151_790688251033307_6929257105206545597_n','','inherit','open','closed','','13612151_790688251033307_6929257105206545597_n','','','2016-10-01 19:37:55','2016-10-01 19:37:55','',16,'http://localhost/wp-content/uploads/2016/10/13612151_790688251033307_6929257105206545597_n.jpg',0,'attachment','image/jpeg',0),(19,1,'2016-10-01 19:42:46','2016-10-01 19:42:46','<img class=\"alignleft wp-image-17 size-medium\" src=\"http://localhost/wp-content/uploads/2016/10/13612151_790688251033307_6929257105206545597_n-300x225.jpg\" alt=\"13612151_790688251033307_6929257105206545597_n\" width=\"300\" height=\"225\" />\r\nLorem ipsum dolor sit amet, consectetur adipisicing elit, sed do eiusmod tempor incid- idunt ut labore et dolore magna aliqua. Ut enim ad minim veniam, quis nostrud exerci- tation ullamco laboris nisi ut aliquip ex ea commodo consequat. Duis aute irure dolor in reprehenderit in voluptate velit esse.\r\n\r\nLorem ipsum dolor sit amet, consectetur adipisicing elit, sed do eiusmod tempor incid- idunt ut labore et dolore magna aliqua. Ut enim ad minim veniam, quis nostrud exerci- tation ullamco laboris nisi ut aliquip ex ea commodo consequat. Duis aute irure dolor in reprehenderit in voluptate velit esse.','OUR MISSION','','inherit','closed','closed','','16-revision-v1','','','2016-10-01 19:42:46','2016-10-01 19:42:46','',16,'http://localhost/2016/10/01/16-revision-v1/',0,'revision','',0),(22,1,