7-01-08 02:40:11','',6,'http://pahadidagdya.com/wp-content/uploads/2016/10/fd68bea0-c15a-4c1f-bc96-1b2550512ec4.jpg',0,'attachment','image/jpeg',0),(645,1,'2017-01-08 08:10:15','2017-01-08 02:40:15','','PD_B_V6','','inherit','closed','closed','','pd_b_v6-2','','','2017-01-08 08:10:15','2017-01-08 02:40:15','',6,'http://pahadidagdya.com/wp-content/uploads/2016/10/PD_B_V6-1.png',0,'attachment','image/png',0),(646,1,'2017-05-14 21:36:24','2017-05-14 16:06:24','[gallery ids=\"645,644,632,630,633,635,637,642,643\"]\r\n\r\n<center><b>ʺHe who opens a school door, closes a prison.ʺ – Victor Hugo</b></center>\r\nPahadi Dagdya - friend from the Hills, is opening that school door for all the economically deprived children of Uttarakhand . It was started by 4 friends as a voluntary effort and now has joined by 127 other friends. Pahadi Dagdya, so far has reached out 93 children of 13 schools of Pauri and Tehri Garhwal by providing them with fees, bags, books and uniforms.\r\n\r\nDoubtless, education is the most powerful catalyst for social transformation. But child education cannot be done in isolation. A child will go to school only if the family income is good. Realizing this, Pahadi Dagdya, beginning in the corridors of education, adopted a lifecycle approach of development by providing the child with financial aid so that he or she can come to school.\r\n\r\nThis poverty damages childhood with significant effects on a child’s physical and mental health, as well as educational achievement. It limits the expectations of the child’s ability to perform well in school,. For this reason, Pahadi Dagdya also identifies and encourages the dropouts to continue their education.\r\n\r\nThe poor and underprivileged kids lag at all stages of education. When earning a livelihood and taking care of the members of the family becomes a primary matter of concern in one’s life, education stands a little or, very often, no chance of pursuance. For many underprivileged children education is a high-priced luxury, So, Pahadi dagdya took an initiative for providing assistance to these kids. It has already helped 93 such kids.\r\n\r\nIt believes that unless members of the civil society are involved proactively in the process of development, sustainable change will not happen. Following this model of Civic Driven Change, Pahadi Dagdya sensitizes and engages the civil society by holding valuable meetings wherever and whenever possible on important issues.\r\nIt is also equipped with its own newsletter which can elaborate upon the news related to its latest achievement, ongoing work and future projects. Moreover, Pahadi Dagdya is gathering attention over social platforms as it actively shares the eye catching and important information regarding Uttarakhand and their people which is liked by many.\r\nToday, 8 million children in India are out of school – surrounded by poverty and despair; they are fighting a daily battle for their education. Pahadi Dagdya wants to bring hope in their lives. So let’s be together and bring a change and make it last.','We Support Child Education','','inherit','closed','closed','','6-autosave-v1','','','2017-05-14 21:36:24','2017-05-14 16:06:24','',6,'http://pahadidagdya.com/?p=646',0,'revision','',0),(647,1,'2017-01-08 08:10:34','2017-01-08 02:40:34','[gallery ids=\"629,630,631,632,633,634,635,636,637,638,639,640,641,642,643,644,645\"]\r\n\r\nPahadi Dagdya is an organization that finds its roots in the beautiful &amp; serene mountains of Uttarakhand. What was started by 4 friends as a voluntary effort to help the economically deprived children of our homeland, is today a not-for-profit organization that is joined by 127 people who share the vision to provide support to these kids. We believe that every child has the right to seek education and if he or she finds hindrance in doing so we at Pahadi Dagdya are there to help those kids by providing them with Books, Paying their Tuition Fee, Providing them with uniform and shoes. Our aim is to overcome all obstacles that come in the way of these kids and their development. Pahadi Dagdya means friend from the Hills, and just like any good friend we offer support of every kind to ensure the growth &amp; development of our tiny little friends.','Welcome to Pahadi Dagdya group','','inherit','closed','closed','','6-revision-v1','','','2017-01-08 08:10:34','2017-01-08 02:40:34','',6,'http://pahadidagdya.com/?p=647',0,'revision','',0),(648,1,'2017-01-08 08:13:33','2017-01-08 02:43:33','[gallery ids=\"645,644,632,630,629,631,633,634,635,636,637,638,639,641,642,643\"]\r\n\r\nPahadi Dagdya is an organization that finds its roots in the beautiful &amp; serene mountains of Uttarakhand. What was started by 4 friends as a voluntary effort to help the economically deprived children of our homeland, is today a not-for-profit organization that is joined by 127 people who share the vision to provide support to these kids. We believe that every child has the right to seek education and if he or she finds hindrance in doing so we at Pahadi Dagdya are there to help those kids by providing them with Books, Paying their Tuition Fee, Providing them with uniform and shoes. Our aim is to overcome all obstacles that come in the way of these kids and their development. Pahadi Dagdya means friend from the Hills, and just like any good friend we offer support of every kind to ensure the growth &amp; development of our tiny little friends.','Welcome to Pahadi Dagdya group','','inherit','closed','closed','','6-revision-v1','','','2017-01-08 08:13:33','2017-01-08 02:43:33','',6,'http://pahadidagdya.com/?p=648',0,'revision','',0),(651,1,'2017-01-27 20:40:31','2017-01-27 15:10:31','[gallery ids=\"645,644,632,630,633,635,636,637,639,642,643\"]\r\n\r\nPahadi Dagdya is an organization that finds its roots in the beautiful &amp; serene mountains of Uttarakhand. What was started by 4 friends as a voluntary effort to help the economically deprived children of our homeland, is today a not-f