AGDYA meeting held on 16th October, 2016 at Indian Coffee House, CP, New Delhi\r\n\r\n[ngg_images source=\"galleries\" container_ids=\"43\" sortorder=\"237,235,236,238\" display_type=\"photocrati-nextgen_basic_thumbnails\" override_thumbnail_settings=\"1\" thumbnail_width=\"240\" thumbnail_height=\"180\" thumbnail_crop=\"1\" images_per_page=\"10\" number_of_columns=\"0\" ajax_pagination=\"1\" show_all_in_lightbox=\"0\" use_imagebrowser_effect=\"1\" show_slideshow_link=\"1\" slideshow_link_text=\"Monthly Meeting\" template=\"default\" slug=\"Monthly-Meeting-October-2016\" order_by=\"sortorder\" order_direction=\"ASC\" returns=\"included\" maximum_entity_count=\"500\"]','Monthly Meeting on 16th October 2016','','inherit','closed','closed','','789-revision-v1','','','2017-03-28 22:36:06','2017-03-28 17:06:06','',789,'http://pahadidagdya.com/?p=801',0,'revision','',0),(802,1,'2016-09-24 22:19:30','2016-09-24 16:49:30','गरीब परिवार के बच्चो के लिए एक बार फिरसे हमारा पहाड़ी दगड्या पहुँचा अपने पहाड़।\r\n\r\nथैलीसैंण के तीन स्कूल के 10 बच्चो की सहायता करी गई। जो है भगवाड़ी गाँव में 2 बच्चे, भेलसेन गाँव में 2 बच्चे, पलान गाँव में 6 बच्चे।।\r\n<div class=\"text_exposed_show\">\r\n\r\nहम भगवान से प्रार्थना करते है कि इन बच्चो का भविष्य बेहद ही सुन्दर हो और ये निरंतर प्रगतिशील हो।।\r\n\r\nइस बार इस कार्य की कमान संभाली श्री उदय ममगाईं राठी भाई, श्री रोहित सुन्द्रियाल भाई और श्री आशीष सुन्द्रियाल भाई ने (जो की ये कार्य बहुत बार कर चुके है)।\r\n\r\nहम पहाड़ी दगड्या की ओर से इन तीनो का हृदय से आभार व्यक्त करते है।। धन्यवाद\r\n\r\nजय बद्री विशाल।।\r\n\r\n[ngg_images source=\"galleries\" container_ids=\"44\" sortorder=\"246,239,240,241,242,243,244,245,247,248\" display_type=\"photocrati-nextgen_basic_thumbnails\" override_thumbnail_settings=\"1\" thumbnail_width=\"240\" thumbnail_height=\"180\" thumbnail_crop=\"1\" images_per_page=\"10\" number_of_columns=\"0\" ajax_pagination=\"1\" show_all_in_lightbox=\"0\" use_imagebrowser_effect=\"1\" show_slideshow_link=\"1\" slideshow_link_text=\"