2','0000-00-00 00:00:00','eyJpZF9maWVsZCI6IklEIiwiX19kZWZhdWx0c19zZXQiOnRydWV9','Untitled ngg_pictures','','draft','closed','closed','','mixin_nextgen_table_extras','','','2017-03-29 22:27:12','2017-03-29 16:57:12','eyJpZF9maWVsZCI6IklEIiwiX19kZWZhdWx0c19zZXQiOnRydWV9',0,'http://pahadidagdya.com/?p=824',0,'ngg_pictures','',0),(825,1,'2017-03-29 22:25:51','2017-03-29 16:55:51','','Thailisain me pahadi dagdya','','inherit','closed','closed','','14434961_303690079997937_6575690072611594186_o','','','2017-03-29 22:26:09','2017-03-29 16:56:09','',802,'http://pahadidagdya.com/wp-content/uploads/2017/03/14434961_303690079997937_6575690072611594186_o.jpg',0,'attachment','image/jpeg',0),(826,1,'2017-03-29 22:26:15','2017-03-29 16:56:15','24 सितम्बर, 2016\r\n\r\nगरीब परिवार के बच्चो के लिए एक बार फिरसे हमारा पहाड़ी दगड्या पहुँचा अपने पहाड़।\r\n\r\nथैलीसैंण के तीन स्कूल के 10 बच्चो की सहायता करी गई। जो है भगवाड़ी गाँव में 2 बच्चे, भेलसेन गाँव में 2 बच्चे, पलान गाँव में 6 बच्चे।।\r\n<div class=\"text_exposed_show\">\r\n\r\nहम भगवान से प्रार्थना करते है कि इन बच्चो का भविष्य बेहद ही सुन्दर हो और ये निरंतर प्रगतिशील हो।।\r\n\r\nइस बार इस कार्य की कमान संभाली श्री उदय ममगाईं राठी भाई, श्री रोहित सुन्द्रियाल भाई और श्री आशीष सुन्द्रियाल भाई ने (जो की ये कार्य बहुत बार कर चुके है)।\r\n\r\nहम पहाड़ी दगड्या की ओर से इन तीनो का हृदय से आभार व्यक्त करते है।। धन्यवाद\r\n\r\nजय बद्री विशाल।।\r\n\r\n[ngg_images source=\"galleries\" container_ids=\"44\" sortorder=\"246,239,240,241,242,243,244,245,247,248\" display_type=\"photocrati-nextgen_basic_thumbnails\" override_thumbnail_settings=\"1\" thumbnail_width=\"240\" thumbnail_height=\"180\" thumbnail_crop=\"1\" images_per_page=\"10\" number_of_columns=\"0\" ajax_pagination=\"1\" show_all_in_lightbox=\"0\" use_imagebrowser_effect=\"1\" show_slideshow_link=\"1\" slideshow_link_text=\"Thailisain 24-Sep-2016\" template=\"default\" slug=\"Thailisain-24-Sep-2016\" order_by=\"sortorder\" order_direction=\"ASC\" returns=\"included\" maximum_entity_count=\"500\"]</div>','थैलीसैंण में पहाड़ी दगड्या.','','inherit','closed','closed','','802-revision-v1','','','2017-03-29 22:26:15','2017-03-29 16:56:15','',802,'http://pahadidagdya.com/?p=826',0,'revision','',0),(827,1,'2017-03-29 22:27:32','2017-03-29 16:57:32','गरीब परिवार के बच्चो के लिए एक बार फिरसे हमारा पहाड़ी दगड्या पहुँचा अपने पहाड़।\r\n\r\nथैलीसैंण के तीन स्कूल के 10 बच्चो की सहायता करी गई। जो है भगवाड़ी गाँव में 2 बच्चे, भेलसेन गाँव में 2 बच्चे, पलान गाँव में 6 बच्चे।।\r\n<div class=\"text_exposed_show\">\r\n\r\nहम भगवान से प्रार्थना करते है कि इन बच्चो का भविष्य बेहद ही सुन्दर हो और ये निरंतर प्रगतिशील हो।।\r\n\r\nइस बार इस कार्य की कमान संभाली श्री उदय ममगाईं राठी भाई, श्री रोहित सुन्द्रियाल भाई और श्री आशीष सुन्द्रियाल भाई ने (जो की ये कार्य बहुत बार कर चुके है)।\r\n\r\nहम पहाड़ी दगड्या की ओर से इन तीनो का हृदय से आभार व्यक्त करते है।। धन्यवाद\r\n\r\nजय बद्री विशाल।।\r\n\r\n[ngg_images source=\"galleries\" container_ids=\"44\" sortorder=\"246,239,240,241,242,243,244,245,247,248\" display_type=\"photocrati-nextgen_basic_thumbnails\" override_thumbnail_settings=\"1\" thumbnail_width=\"240\" thumbnail_height=\"180\" thumbnail_crop=\"1\" images_per_page=\"10\" number_of_columns=\"0\" ajax_pagination=\"1\" show_all_in_lightbox=\"0\" use_imagebrowser_effect=\"1\" show_slideshow_link=\"1\" slideshow_link_text=\"Thailisain 24-Sep-2016\" template=\"default\" slug=\"Thailisain-24-Sep-2016\" order_by=\"sortorder\" order_direction=\"ASC\" returns=\"included\" maximum_entity_count=\"500\"]</div>','थैलीसैंण में पहाड़ी दगड्या.','','inherit','closed','closed','','802-revision-v1','','','2017-03-29 22:27:32','2017-03-29 16:57:32','',802,'http://pahadidagdya.com/?p=827',0,'revision','',0),(828,1,'2016-09-21 22:30:03','2016-09-21 17:00:03','<div id=\"js_6nz\" class=\"_5pbx userContent\" data-ft=\"{&quot;tn&quot;:&quot;K&quot;}\">\r\n<div id=\"id_58da9234c48f37c73092420\" class=\"text_exposed_root text_exposed\">\r\n\r\nबहुत ही ख़ुशी होती है जब हम अपने एक छोटे से प्रयास के कारण किसी की जिन्दगी में एक दिया जलाने की कोशिश करते है, और यकीन मानो दोस्तों ये ख़ुशी तब और बढ़ जाती है जब हम अपने उत्तराखंड के छोटे और निसहाय बच्चो के उज्जवल भविष्य के लिए करते है।।\r\n\r\nजी हाँ, ऐसा ही कुछ किया हमारे \"पहाड़ी दगड्या\" (a sub Group of Garhwali Brahmin) संस्था ने, जब टिहरी के अंथवाल गाँव के विद्यालय में हमने 5 बच्चो की मदद करी।।\r\n\r\nइस सामाजिक कार्य करने के लिए स्वेछा से आगे आने वाले भाई श्री Pankaj Naithani का मैं अपनी <span class=\"text_exposed_show\">संस्था की और से आभार प्रकट करता हूँ।।\r\nजो अभी कुछ दिन पहले ही बीमारी से उबरे थे, लेकिन इस अच्छे कार्य में विलम्ब न हो तो खुद आगे आकर के ये कार्य का बीड़ा उठाया और इन बच्चो की मदद करी।।</span>\r\n<div class=\"text_exposed_show\">\r\n\r\nहम सब इन बच्चो के मंगल व् सुनहरे भविष्य की आशा करते है, जिससे वो समाज और देशहित के लिए काम कर सके और साथ ही साथ हमारे देवभूमि उत्तराखंड का नाम पूरी दुनिया रोशन कर सके।।\r\n\r\nजय देवभूमि उत्तराखंड<span class=\"_5mfr _47e3\"><img class=\"img\" src=\"https://www.facebook.com/images/emoji.php/v8/f1f/2/16/1f64f.png\" alt=\"\" width=\"16\" height=\"16\"><span class=\"_7oe\">?</span></span>\r\nजय बद्री विशाल<span class=\"_5mfr _47e3\"><img class=\"img\" src=\"https://www.facebook.com/images/emoji.php/v8/f1f/2/16/1f64f.png\" alt=\"\" width=\"16\" height=\"16\"><span class=\"_7oe\">?</span></span>\r\n\r\n</div>\r\n</div>\r\n</div>\r\n<div class=\"_3x-2\">&nbsp;[ngg_images source=\"galleries\" container_ids=\"45\" sortorder=\"253,249,251,252,254,255,257,256,250,258\" display_type=\"photocrati-nextgen_basic_thumbnails\" override_thumbnail_settings=\"1\" thumbnail_width=\"240\" thumbnail_height=\"180\" thumbnail_crop=\"1\" images_per_page=\"10\" number_of_columns=\"0\" ajax_pagination=\"1\" show_all_in_lightbox=\"0\" use_imagebrowser_effect=\"1\" show_slideshow_link=\"1\" slideshow_link_text=\"Anthwal School Tehri\" template=\"default\" slug=\"Anthwal-School-Tehri\" order_by=\"sortorder\" order_direction=\"ASC\" returns=\"included\" maximum_entity_count=\"500\"]</div>','Pahadi DAGDYA at