reference to those students who are:\r\n1. Girls\r\n2. Orphans\r\n3. Brilliant in Studies but whose parents can\'t support their studies\r\n\r\n# Governing Body was finalised as per below details:\r\n\r\n1. President : Shri Alok Vaishnav\r\n\r\n2. Vice President : Shri Kamal Dhyani\r\n\r\n3. General Secretary : Shri Jitender Lakhera\r\n\r\n4. Joint Secretary : Shri Pankaj Naithani\r\n\r\n5. Assistant Secretary : Shri Ashish Lakhera\r\n\r\n6. Treasure : Shri Surendra Lakhera &amp; Shri Rinkaj Kandwal\r\n\r\n# A Format for Membership Registration will be distributed to all the members soon. All members download the form fill up and handover same to Governing Body in next meeting.\r\n\r\n# Registering our Group as an Cooperative Society is in process and it will be completed soon.\r\n\r\n# Discussion on need for group of Volunteers, who can ask / verify the needy\'s details and can visit uttarakhand for giving doles in cash or kind will continue in our next meeting.\r\n\r\n# A Powerpoint presentation will be prepared for our group showing its background and working.\r\n\r\n# Means of Fund Collection were also discussed by way of selling Pahadi Dagdya Tshirts or from utlising the concept of Uttarakhand Fresh.\r\n\r\n# On the spot, Fund collection was Rs. 15,402\r\n\r\n# Our next meeting is fixed for 19th June, 2016 at same venue.\r\n\r\n# It has been agreed that we are very naive and can be seen a little unorganized but we are very determined to give back to our Devbhoomi Uttarakhand..\r\n\r\nWith the help, guidance &amp; suggestions from like minded people, gradually we will make our presence felt in Uttarakhand\r\n\r\n[ngg_images source=\"galleries\" container_ids=\"49\" display_type=\"photocrati-nextgen_basic_thumbnails\" override_thumbnail_settings=\"1\" thumbnail_width=\"240\" thumbnail_height=\"180\" thumbnail_crop=\"1\" images_per_page=\"10\" number_of_columns=\"0\" ajax_pagination=\"1\" show_all_in_lightbox=\"0\" use_imagebrowser_effect=\"1\" show_slideshow_link=\"1\" slideshow_link_text=\"MonthlyMeetingMay2016\" template=\"default\" slug=\"Monthly-Meeting-May-2016\" order_by=\"sortorder\" order_direction=\"ASC\" returns=\"included\" maximum_entity_count=\"500\"]</div>','Monthly Meeting 15 May 2016','','inherit','closed','closed','','886-revision-v1','','','2017-03-29 22:57:33','2017-03-29 17:27:33','',886,'http://pahadidagdya.com/?p=918',0,'revision','',0),(919,1,'2016-05-23 22:58:00','2016-05-23 17:28:00','We have achieved another milestone with the help of our Group members.\r\nTotal no. of 16 Students were supported in Cash &amp; kind from 4 different schools (Adalikhal, Khirerikhal, Dungri &amp; SaltMahadev).\r\nShri Ashish Sundriyal work tediously and made it happened for us.\r\nPahadi Dagdya distributed School Bags, Uniforms, Notebooks also Yearly fees was deposited / handed over to the School Principals in front of Student\'s Guardian.\r\n\r\n[ngg_images source=\"galleries\" container_ids=\"50\" sortorder=\"283,282,284,285,286,287,288,289,290,291,292,293,294,295,296,297,298\" display_type=\"photocrati-nextgen_basic_thumbnails\" override_thumbnail_settings=\"1\" thumbnail_width=\"240\" thumbnail_height=\"180\" thumbnail_crop=\"1\" images_per_page=\"10\" number_of_columns=\"0\" ajax_pagination=\"1\" show_all_in_lightbox=\"0\" use_imagebrowser_effect=\"1\" show_slideshow_link=\"1\" slideshow_link_text=\"2ndMileStone\" template=\"default\" slug=\"2nd-Mile-Stone\" order_by=\"sortorder\" order_direction=\"ASC\" returns=\"included\" maximum_entity_count=\"500\"]','2nd Milestone of Pahadi Dagdya','','publish','closed','closed','','2nd-milestone-of-pahadi-dagdya','','','2017-03-30 08:23:59','2017-03-30 02:53:59','',0,'http://pahadidagdya.com/?p=919',0,'post','',0),(920,1,'2017-03-29 23:01:11','0000-00-00 00:00:00','eyJpZF9maWVsZCI6IklEIiwiX19kZWZhdWx0c19zZXQiOnRydWV9','Untitled ngg_gallery','','draft','closed','closed','','mixin_nextgen_table_extras','','','2017-03-29 23:01:11','0000-00-00 00:00:00','eyJpZF9maWVsZCI6IklEIiw