35303137971876_n','','inherit','closed','closed','','13227104_239522009748078_1907935303137971876_n-3','','','2017-03-30 08:23:44','2017-03-30 02:53:44','',919,'http://pahadidagdya.com/wp-content/uploads/2016/05/13227104_239522009748078_1907935303137971876_n-2.jpg',0,'attachment','image/jpeg',0),(1008,1,'2017-04-03 08:30:15','2017-04-03 03:00:15','[gallery ids=\"645,644,632,630,633,635,637,642,643\"]\r\n\r\nPahadi Dagdya is an organization that finds its roots in the beautiful &amp; serene mountains of Uttarakhand. What was started by 4 friends as a voluntary effort to help the economically deprived children of our homeland, is today a not-for-profit organization that is joined by 127 people who share the vision to provide support to these kids. We believe that every child has the right to seek education and if he or she finds hindrance in doing so we at Pahadi Dagdya are there to help those kids by providing them with Books, Paying their Tuition Fee, Providing them with uniform and shoes. Our aim is to overcome all obstacles that come in the way of these kids and their development. Pahadi Dagdya means friend from the Hills, and just like any good friend we offer support of every kind to ensure the growth &amp; development of our tiny little friends.','We Support Child Education','','inherit','closed','closed','','6-revision-v1','','','2017-04-03 08:30:15','2017-04-03 03:00:15','',6,'http://pahadidagdya.com/?p=1008',0,'revision','',0),(1010,1,'2017-04-17 08:29:03','2017-04-17 02:59:03','We have a fruitful discussion in the meeting held at Rohini Sector 17, New Delhi in Madhu Dobhal ji house..\r\nTotal of 16 members attended\r\nDiscussed the following:-\r\n1. Next week, our team is going to visit those schools where last year, we have distributed School bags, notebooks, uniforms, shoes, apart from paying annual fees of the children\'s (In Salt-Mahadev, Dungri, Khirerikhal, Laachi, Jogimarhi)\r\n2. We will also going to provide these things to new bunch of children\'s in a school from Uffrekhal..\r\n3. A TV crew is also going with us in..We will also make a documentary film on the activities of Pahadi Dagdya which will be available in social media..\r\n4. Our next team will also be visiting Palethi School where new set of children\'s are waiting for us.\r\n5. A general appeal is made to the people to join us and do their bit for devbhumi uttrakhand in their own capacity\r\n\r\n[ngg_images source=\"galleries\" container_ids=\"53\" sortorder=\"327,317,318,319,320,321,322,323,324,325,326\" display_type=\"photocrati-nextgen_basic_thumbnails\" override_thumbnail_settings=\"1\" thumbnail_width=\"240\" thumbnail_height=\"180\" thumbnail_crop=\"1\" images_per_page=\"10\" number_of_columns=\"0\" ajax_pagination=\"1\" show_all_in_lightbox=\"0\" use_imagebrowser_effect=\"1\" show_slideshow_link=\"1\" slideshow_link_text=\"Monthly Meetting 16 Apr 2017\" template=\"default\" slug=\"Monthly-Metting-16-Apr-2017\" order_by=\"sortorder\" order_direction=\"ASC\" returns=\"included\" maximum_entity_count=\"500\"]','Pahadi Dagdya Meeting on 16 April 2017','','publish','closed','closed','','pahadi-dagdya-meeting-on-16-april-2017','','','2017-04-19 08:38:04','2017-04-19 03:08:04','',0,'http://pahadidagdya.com/?p=1010',0,'post','',0),(1011,1,'2017-04-19 08:34:23','0000-00-00 00:00:00','eyJpZF9maWVsZCI6IklEIiwiX19kZWZhdWx0c19zZXQiOnRydWV9','Untitled ngg_gallery','','draft','closed','closed','','mixin_nextgen_table_extras','','','2017-04-19 08:34:23','0000-00-00 00:00:00','eyJpZF9maWVsZCI6IklEIiwiX19kZWZhdWx0c19zZXQiOnRydWV9',0,'http://pahadidagdya.com/?p=1011',0,'ngg_gallery','',0),(1012,1,'2017-04-19 08:34:23','0000-00-00 00:00:00','eyJpZF9maWVsZCI6IklEIiwiX19kZWZhdWx0c19zZXQiOnRydWV9','Untitled ngg_pictures','','draft','closed','closed','','mixin_nextgen_table_extras','','','2017-04-19 08:34:23','0000-00-00 00:00:00','eyJpZF9maWVsZCI6IklEIiwiX19kZWZhdWx0c19zZXQiOnRydWV9',0,'http://pahadidagdya.com/?p=1012',0,'ngg_pictures','',0),(1013,1,'2017-04-19 0