_n','','','2017-04-19 08:37:31','2017-04-19 03:07:31','',1010,'http://pahadidagdya.com/wp-content/uploads/2017/04/18010732_410194636014147_6901407199789448070_n.jpg',0,'attachment','image/jpeg',0),(1036,1,'2017-04-19 08:38:04','2017-04-19 03:08:04','We have a fruitful discussion in the meeting held at Rohini Sector 17, New Delhi in Madhu Dobhal ji house..\r\nTotal of 16 members attended\r\nDiscussed the following:-\r\n1. Next week, our team is going to visit those schools where last year, we have distributed School bags, notebooks, uniforms, shoes, apart from paying annual fees of the children\'s (In Salt-Mahadev, Dungri, Khirerikhal, Laachi, Jogimarhi)\r\n2. We will also going to provide these things to new bunch of children\'s in a school from Uffrekhal..\r\n3. A TV crew is also going with us in..We will also make a documentary film on the activities of Pahadi Dagdya which will be available in social media..\r\n4. Our next team will also be visiting Palethi School where new set of children\'s are waiting for us.\r\n5. A general appeal is made to the people to join us and do their bit for devbhumi uttrakhand in their own capacity\r\n\r\n[ngg_images source=\"galleries\" container_ids=\"53\" sortorder=\"327,317,318,319,320,321,322,323,324,325,326\" display_type=\"photocrati-nextgen_basic_thumbnails\" override_thumbnail_settings=\"1\" thumbnail_width=\"240\" thumbnail_height=\"180\" thumbnail_crop=\"1\" images_per_page=\"10\" number_of_columns=\"0\" ajax_pagination=\"1\" show_all_in_lightbox=\"0\" use_imagebrowser_effect=\"1\" show_slideshow_link=\"1\" slideshow_link_text=\"Monthly Meetting 16 Apr 2017\" template=\"default\" slug=\"Monthly-Metting-16-Apr-2017\" order_by=\"sortorder\" order_direction=\"ASC\" returns=\"included\" maximum_entity_count=\"500\"]','Pahadi Dagdya Meeting on 16 April 2017','','inherit','closed','closed','','1010-revision-v1','','','2017-04-19 08:38:04','2017-04-19 03:08:04','',1010,'http://pahadidagdya.com/?p=1036',0,'revision','',0),(1040,1,'2017-05-01 20:31:57','2017-05-01 15:01:57','पहाड़ी दगड़्या और आईवोरी इमेजिनेशन टीम अपने प्लान के अनुसार उत्तराखंड के 7 स्कूलों में अपनी मदद पहुंचाने के लिए 20 /04 /2017 को सुबह 00:30 मिनट पर दिल्ली से उत्तराखंड के लिए रवाना हुई।\r\n\r\nहमारा रास्ते भर का सफर आनन्दमय और मंगलमय रहा पर रास्ते में ब्रिजघाट टोल में लगे जाम के कारण हम स्कूलो में दिए गए टाइम के अनुसार 2 घंटे लेट पहुंचे। पर फिर भी हमारी टीम अपने काम में जुटी और उत्तराखंड के पहली स्कूल \"राजकीय उच्च माध्यमिक विद्यालय सल्डमहादेव\" में हमारी टीम का स्वागत किया गया और वहाँ पर हमने तीन अल्प आय वर्ग के बच्चों को अपनी मदद पहुचायी।\r\n\r\nवहाँ से हमारी टीम दूसरे स्कूल \"राजकीय इंटर कॉलेज खिरैरीखाल\" के लिए रवाना हुयी।\r\nखिरैरीखाल पहुंचते ही प्रधानाचाय॔ और अध्यापकों ने हमारी टीम का भव्य स्वागत किया और माल्यार्पण किया, जो की सदैव स्मरणीय रहेगा।\r\n\r\n[ngg_images source=\"galleries\" container_ids=\"54\" sortorder=\"329,330,328,331,332,333,334,335,336,338,339,340,341,337,342\" display_type=\"photocrati-nextgen_basic_thumbnails\" override_thumbnail_settings=\"1\" thumbnail_width=\"240\" thumbnail_height=\"180\" thumbnail_crop=\"1\" images_per_page=\"10\" number_of_columns=\"0\" ajax_pagination=\"1\" show_all_in_lightbox=\"0\" use_imagebrowser_effect=\"1\" show_slideshow_link=\"1\" slideshow_link_text=\"SaldMahadev_Adalikhal_Jogimari\" template=\"default\" slug=\"SaldMahadev_Adalikhal_Jogimari\" order_by=\"sortorder\" order_direction=\"ASC\" returns=\"included\" maximum_entity_count=\"500\"]वहाँ से पहाड़ी दगड़्या टीम \"जनता इंटर कॉलेज अदालीखाल स्कूल\" के लिए आगे बढ़ी लेकिन वहां पहुंच कर हमें बहुत ही निराशा हुयी क्यूंकि खिरैरीखाल स्कूल से निकले ही अदलीखाल स्कूल के लिए सुचना भेज दी गयी थी पर फिर भी अदालीखाल स्कूल ने अपने समय के अनुसार 12:40 पर स्कूल की छुटटी कर दी। हम लोग स्कूल समय के अनुसार 8 मिनट देरी से पहुंचे।\r\n\r\nवहाँ से हम लोग आशीष सुंदरियाल के गांव बसोली पहुंचे और दोपहर का भोजन किया। और फिर हम लोग वहां से 3:20 बजे अपने अगले स्कूल जोगीमढी के लिए रवाना हुये और उसी दिन की शाम 06:30 बजे हम लोग \"जनता इंटर कॉलेज जोगीमढी\" स्कूल पहुंच गए। वहाँ पर श्री मूकेश शार्मा (गौर) जी द्वारा हमलोगों के लिए रात्रि विश्राम और खाने की उत्तम ब्यवस्था की गयी थी।\r\n\r\nअगले दिन 21/04/2017 को सुबह 7:00 बजे से पहाड़ी दगड़्या टीम और आईवोरी इमेजिनेशन टीम प्रमोशनल मूवी बनाने में जुट गयी और प्रराईमरी स्कूल में बच्चों के साध कला प्रतियोगिता मैं भाग लिया। नोट करने की बात ये है कि वहाँ के स्कूल की हालत बहुत ही जर्जरता पूर्ण हैं। अध्यापको ने हम से स्कूल के लिए अनुदान की प्रथ॓ना की ।\r\n\r\nजनता इंटर कॉलेज जोगीमढी में समाज सेवी श्री पातीराम ढौंनडियाल जी मिले और उनसे हमै पता चला कि एक बच्चा जो नजदीकी बजार बैजरो में गाड़ियां साफ़ करता है, उसके लिए उन्होंने मदद माँगी। पहाड़ी दगड़्या ने उसी समय उस बच्चे को गोद लिया और उसके आगे की पढ़ाई लिखायी की जिम्मेदारी का आश्वाशन दिया।\r\n\r\nफिर जोगीमढी से हमारी टीम अपने अगले स्कूल लाछी की लिए रवाना हुई। लाछी स्कूल पहुंच कर अध्यापको से बातचीत करके पता चला की उनके स्कूल में पढ़ रहे दो बच्चों के माता पिता का बैजरो कार अक्सीडेंट में निधन हो गया था। यह जानकार पहाड़ी दगड़्या ने दुख जताया और उन दोनों बच्चो की पढ़ाई की पूरी जिम्मेदारी ली।\r\n\r\nऔर फिर यहां से हमारी टीम श्री तेजराम शर्मा (ढौंडियाल) जी की बहन के गांव - सीला मल्ला पहुंची। वहां पर दोपहर भोजन का बहुत अच्छा प्रबन्द किया गया था. दिन का खाना खाकर हम दोपहर 03:30 बजे अपने अगले स्कूल उफरैखाल के लिए रवाना हुऐ।\r\n\r\nशाम 06:45 मिनट पर पूरी टीम उफरैखाल पहुंच गयी थी। वहा पहुंचते ही हमारे उपाध्यक्ष श्री तेजराम शर्मा जी हमे पहले सीधे स्कूल दिखाने ले गए, जहाँ हमे अगले दिन वाल पेंटिंग और बच्चों का सत्यापन करके उन्हें मदद पहुचानी थी।\r\nहमने फिर सारे स्कूल का निरीक्षण किया और जहाँ हमे वाल पेंटिंग बनानी जहाँ बनानी थी वो वाल सेलेक्ट की। और फिर वहाँ से श्री तेजराम शर्मा (ढौंडियाल) के गांव - डंडखिल पहुंच गऐ।\r\nश्री तेजराम शर्मा जी के छोटे भाई श्री आनन्दमणीं ढौंडियाल जी ने हमारी टीम का स्वागत किया व उनके रात्रि भोज और रात के ठहरने का बहुत अच्छा प्रबंध भी किया।\r\n\r\nअब अगले दिन 22/०4/2017 की सुबह हमारी टीम को उफरैखाल स्कूल में 8 बजे पहुंचना था पर अचानक शुभह 7 बजे बहुत तेज बारिश और आंधी तूफ़ान आ गया जिसके कारण हम लोगों को गांव - डंडखिल में ही रुकना पड़ा।\r\nजैसे ही 08:00 बजे बारिश बन्द हुईं हमारी टीम 08:30 बजे उफरैखाल स्कूल के लिए रवाना हो गयी। 09:00 बजे स्कूल में पहुंच कर पता चला की बहुत तेज हो रही बारिश के कारण बच्चे स्कूल नहीं आ पाए और जो आये थे वो पूरी तरह भीग चुके थे।\r\nजिसके कारण बच्चो के स्कूल की छुटटी करनी पड़ी परन्तु स्कूल में पूरा स्टाफ था जिनसे हमारी बातचीत हुई।\r\nजो हमे उफरैखाल स्कूल से बच्चो की लिस्ट आयी थी, उसके ऊपर भी बातचीत हुई और साथ ही बहुत ही सुन्दर वाल पेंटिंग भी बनाई गयी।\r\nऔर उफरैखाल में दोपहर भोजन करने के बाद हमारी पूरी टीम दिल्ली के लिए रवाना हो गयी। आखिरकार और 22/04/2017 रात्रि 01:00 बजे दिल्ली पहुंच गयी।\r\n\r\nइसी तरह पहाड़ी दगड़्या का सफर बहुत ही रोमांचित, कार्यशील, ऊर्जावान और सकरात्मक रहा।\r\nइसके लिए हम फिर से तहे दिल से आईवोरी इमेजिनेशन टीम और पहाड़ी दगड़्या के कार्यकर्ताओ (श्री तेजराम शर्मा (ढौंडियाल) जी, श्री आशीष सुन्द्रियाल जी और श्री मनीष बलूनी जी का आभार व्यक्त करते है जिन्होंने अपने व्यस्त जीवन में से इस उत्कृष्ट कार्य को करने के लिए अपना बहुमूल्य समय निकला।\r\n\r\nधन्यवाद।\r\n\r\nपहाड़ी दगडृया टीम','पहाड़ी दगड़या यात्रा वृस्तांत (20 अप्रैल 2017 से 22 अप्रैल 2017)','','publish','closed','closed','','%e0%a4%aa%e0%a4%b9%e0%a4%be%e0%a5%9c%e0%a5%80-%e0%a4%a6%e0%a4%97%e0%a5%9c%e0%a4%af%e0%a4%be-%e0%a4%af%e0%a4%be%e0%a4%a4%e0%a5%8d%e0%a4%b0%e0%a4%be-%e0%a4%b5%e0%a5%83%e0%a4%b8%e0%a5%8d%e0%a4%a4','','','2017-05-01 20:31:57','2017-05-01 15:01:57','',0,'http://pahadidagdya.com/?p=1040',0,'post','',0),(1041,1,'2017-05-01 20:28:22','0000-00-00 00:00:00','eyJpZF9maWVsZCI6IklEIiwiX19kZWZhdWx0c19zZXQiOnRydWV9','Untitled ngg_gallery','','draft','closed','closed','','mixin_nextgen_table_extras','','','2017-05-01 20:28:22','0000-00-00 00:00:00','eyJpZF9maWVsZCI6IklEIiwiX19kZWZhdWx0c19zZXQiOnRydWV9',0,'http://pahadidagdya.com/?p=1041',0,'ngg_gallery','',0),(1042,1,'2017-05-01 20:28:22','0000-00-00 00:00:00','eyJpZF9maWVsZCI6IklEIiwiX19kZWZhdWx0c19zZXQiOnRydWV9','Untitled ngg_pictures','','draft','closed','closed','','mixin_nextgen_table_extras','','','2017-05-01 20:28:22','0000-00-00 00:00:0