 completed this month and final list of the student will be present in next month\'s meeting.</li>\r\n 	<li>Discussed about the Brochures and Memento.</li>\r\n 	<li>We also discussed about the P.D. logo registration.</li>\r\n</ol>\r\n[ngg_images source=\"galleries\" container_ids=\"58\" display_type=\"photocrati-nextgen_basic_thumbnails\" override_thumbnail_settings=\"1\" thumbnail_width=\"240\" thumbnail_height=\"180\" thumbnail_crop=\"1\" images_per_page=\"10\" number_of_columns=\"0\" ajax_pagination=\"1\" show_all_in_lightbox=\"0\" use_imagebrowser_effect=\"1\" show_slideshow_link=\"1\" slideshow_link_text=\"Monthly Meeting 16-Jul-2017\" template=\"default\" slug=\"Monthly-Meeting-16-July-2017\" order_by=\"sortorder\" order_direction=\"ASC\" returns=\"included\" maximum_entity_count=\"500\"]','Pahadi Dagdya Meeting on 16 Jul 2017','','publish','closed','closed','','pahadi-dagdya-meeting-on-16-jul-2017','','','2017-07-22 08:06:37','2017-07-22 02:36:37','',0,'http://pahadidagdya.com/?p=1200',0,'post','',0),(1201,1,'2017-07-22 08:03:13','0000-00-00 00:00:00','eyJpZF9maWVsZCI6IklEIiwiX19kZWZhdWx0c19zZXQiOnRydWV9','Untitled ngg_gallery','','draft','closed','closed','','mixin_nextgen_table_extras','','','2017-07-22 08:03:13','0000-00-00 00:00:00','eyJpZF9maWVsZCI6IklEIiwiX19kZWZhdWx0c19zZXQiOnRydWV9',0,'http://pahadidagdya.com/?p=1201',0,'ngg_gallery','',0),(1202,1,'2017-07-22 08:03:13','0000-00-00 00:00:00','eyJpZF9maWVsZCI6IklEIiwiX19kZWZhdWx0c19zZXQiOnRydWV9','Untitled ngg_pictures','','draft','closed','closed','','mixin_nextgen_table_extras','','','2017-07-22 08:03:13','0000-00-00 00:00:00','eyJpZF9maWVsZCI6IklEIiwiX19kZWZhdWx0c19zZXQiOnRydWV9',0,'http://pahadidagdya.com/?p=1202',0,'ngg_pictures','',0),(1203,1,'2017-07-22 08:06:54','0000-00-00 00:00:00','eyJpZF9maWVsZCI6IklEIiwiX19kZWZhdWx0c19zZXQiOnRydWV9','Untitled ngg_pictures','','draft','closed','closed','','mixin_nextgen_table_extras','','','2017-07-22 08:06:54','2017-07-22 02:36:54','eyJpZF9maWVsZCI6IklEIiwi