'2017-07-22 08:05:55','2017-07-22 02:35:55','',1200,'http://pahadidagdya.com/?p=1228',0,'revision','',0),(1231,1,'2017-08-20 20:17:43','2017-08-20 14:47:43','आज 20 अगस्त 2017, को पहाड़ी दगडृया की मासिक बैठक में &nbsp;निम्न लिखित बिचार सदस्यों के &nbsp;समक्ष रखे गये।&nbsp;\r\n<div dir=\"auto\">1- वित्तीय वर्ष 2016-17 की &nbsp;वित्तीय ब्योरे की रिपोर्ट रखी गई। &nbsp;</div>\r\n<div dir=\"auto\">2- सितंबर माह में 67 बच्चों को सहायता प्रदान करने हेतु गढ़वाल जाने के लिए संगठन की ओर से सदस्यों का चयन व तारीख तय की जायेगी। &nbsp;</div>\r\n<div dir=\"auto\">3- सितंबर माह की बैठक पहले सप्ताह के रविवार को &nbsp;रखी जाएगी और इस बैठक में उत्तराखंड के स्कूलों में बच्चों की सहायता पर बिचार विमर्श किया जाएगा।&nbsp;</div>\r\n<div dir=\"auto\">4- &nbsp;सदस्यता के उपर पुनह बिचार किया जाएगा। जो लोग पहाड़ी दगडृया की मासिक बैठक, अनुदान &nbsp;में और कार्यक्रमों में आगे बढ़कर भाग लेंगे &nbsp;उन्हें ही सदस्यता दी जायेगी।&nbsp;</div>\r\n<div dir=\"auto\">5- पहाड़ी दगडृया की मासिक बैठक में 7 राज्यों में बच्चों की सहायता हेतु पिछली तीन सभाओं में बिचाराधीन रहा किन्तु परिणाम अभी तक बिचाराधीन तक ही सीमित रहा, हमारे सदस्य जो बिभिन शहरों में कार्यरत हैं वे इस दिशा में सहयोग प्रदान करने में असमर्थ रहे।&nbsp;</div>\r\n<div dir=\"auto\">6- समिति के बैक खाते की जानकारी सभी उपस्थित सदस्यों को दी गयी।&nbsp;</div>\r\n<div dir=\"auto\">7- समिति ने &nbsp;पहाड़ी दगडृया की टी शर्ट का रंग व लोगो पर बिचार किया गया यह&nbsp;<img class=\"CToWUd\" src=\"https://mail.google.com/mail/e/1f455\" alt=\"?\" data-goomoji=\"1f455\">&nbsp;टी शर्ट सभी पहाड़ी दगडृया के सदस्यों व अकादमी में उत्कृष्ट प्रदर्शन के लिए विद्यार्थियों को दी जायेगी।&nbsp;</div>\r\n<div dir=\"auto\">और अन्त में सभी सदस्य ने सद्भावना के साथ सभा का समापन किया। धन्यवाद |</div>\r\n<div dir=\"auto\">&nbsp;</div>\r\n<div dir=\"auto\">&nbsp;</div>\r\n<div dir=\"auto\">[ngg_images source=\"galleries\" container_ids=\"65\" display_type=\"photocrati-nextgen_basic_thumbnails\" override_thumbnail_settings=\"1\" thumbnail_width=\"240\" thumbnail_height=\"180\" thu