'inherit','closed','closed','','img_20170820_173846104','','','2017-08-26 20:33:12','2017-08-26 15:03:12','',1231,'http://pahadidagdya.com/wp-content/uploads/2017/08/IMG_20170820_173846104.jpg',0,'attachment','image/jpeg',0),(1248,1,'2017-08-26 20:33:17','2017-08-26 15:03:17','आज 20 अगस्त 2017, को पहाड़ी दगडृया की मासिक बैठक में &nbsp;निम्न लिखित बिचार सदस्यों के &nbsp;समक्ष रखे गये।&nbsp;\r\n<div dir=\"auto\">1- वित्तीय वर्ष 2016-17 की &nbsp;वित्तीय ब्योरे की रिपोर्ट रखी गई। &nbsp;</div>\r\n<div dir=\"auto\">2- सितंबर माह में 67 बच्चों को सहायता प्रदान करने हेतु गढ़वाल जाने के लिए संगठन की ओर से सदस्यों का चयन व तारीख तय की जायेगी। &nbsp;</div>\r\n<div dir=\"auto\">3- सितंबर माह की बैठक पहले सप्ताह के रविवार को &nbsp;रखी जाएगी और इस बैठक में उत्तराखंड के स्कूलों में बच्चों की सहायता पर बिचार विमर्श किया जाएगा।&nbsp;</div>\r\n<div dir=\"auto\">4- &nbsp;सदस्यता के उपर पुनह बिचार किया जाएगा। जो लोग पहाड़ी दगडृया की मासिक बैठक, अनुदान &nbsp;में और कार्यक्रमों में आगे बढ़कर भाग लेंगे &nbsp;उन्हें ही सदस्यता दी जायेगी।&nbsp;</div>\r\n<div dir=\"auto\">5- पहाड़ी दगडृया की मासिक बैठक में 7 राज्यों में बच्चों की सहायता हेतु पिछली तीन सभाओं में बिचाराधीन रहा किन्तु परिणाम अभी तक बिचाराधीन तक ही सीमित रहा, हमारे सदस्य जो बिभिन शहरों में कार्यरत हैं वे इस दिशा में सहयोग प्रदान करने में असमर्थ रहे।&nbsp;</div>\r\n<div dir=\"auto\">6- समिति के बैक खाते की जानकारी सभी उपस्थित सदस्यों को दी गयी।&nbsp;</div>\r\n<div dir=\"auto\">7- समिति ने &nbsp;पहाड़ी दगडृया की टी शर्ट का रंग व लोगो पर बिचार किया गया यह&nbsp;<img class=\"CToWUd\" src=\"https://mail.google.com/mail/e/1f455\" alt=\"?\" data-goomoji=\"1f455\">&nbsp;टी शर्ट सभी पहाड़ी दगडृया के सदस्यों व अकादमी में उत्कृष्ट प्रदर्शन के लिए विद्यार्थियों को दी जायेगी।&nbsp;</div>\r\n<div dir=\"auto\">और अन्त में सभी सदस्य ने सद्भावना के साथ सभा का समापन किया। धन्यवाद |</div>\r\n<div dir=\"auto\">&nbsp;</div>\r\n<div dir=\"auto\">&nbsp;</div>\r\n<div dir=\"auto\">[ngg_images source=\"galleries\" container_ids=\"65\" display_type=\"photocrati-nextgen_basic_thumbnails\" override_thumbnail_settings=\"1\" thumbnail_width=\"240\" thumbnail_height=\"180\" thumbnail_crop=\"1\" images_per_page=\"10\" number_of_columns=\"0\" ajax_pagination=\"1\" show_all_in_lightbox=\"0\" use_imagebrowser_effect=\"1\" show_slideshow_link=\"1\" slideshow_link_text=\"Monthly Meeting 20-Aug-2017\" template=\"default\" slug=\"Monthly_meeting_20-Aug-2017\" order_by=\"sortorder\" order_direction=\"ASC\" returns=\"included\" maximum_entity_count=\"500\"]</div>','Pahadi Dagdya Meeting on 20 अगस्त 2017','','inherit','closed','closed','','1231-revision-v1','','','2017-08-26 20:33:17','2017-08-26 15:03:17','',1231,'http://pahadidagdya.com/?p=1248',0,'revision','',0),(1251,1,'2017-09-17 17:37:10','2017-09-17 12:07:10','&nbsp;\r\n\r\nPahadi Dagdya Meeting on 17 September 2017\r\n\r\n&nbsp;\r\n\r\n[ngg_images source=\"galleries\" container_ids=\"67\" sortorder=\"439,436,437,438,440\" display_type=\"photocrati-nextgen_basic_thumbnails\" override_thumbnail_settings=\"1\" thumbnail_width=\"240\" thumbnail_height=\"180\" thumbnail_crop=\"1\" images_per_page=\"10\" number_of_columns=\"0\" ajax_pagination=\"1\" show_all_in_lightbox=\"0\" use_imagebrowser_effect=\"1\" show_slideshow_link=\"1\" slideshow_link_text=\"Monthly Meeting September 2017\" template=\"default\" slug=\"Monthly-Meeting-Sep-2017\" order_by=\"sortorder\" order_direction=\"ASC\" returns=\"included\" maximum_entity_count=\"500\"]','Pahadi Dagdya Meeting on 17 September 2017','','publish','closed','closed','','pahadi-dagdya-meeting-on-17-september-2017','','','2017-11-25 17:39:41','2017-11-25 12:09:41','',0,'http://pahadidagdya.com/?p=1251',0,'post','',0),(1253,1,'2017-10-08 07:59:02','2017-10-08 02:29:02','Person has two hands, One for helping himself &amp; the Other for helping others!!\r\n\r\nProudly announce that our NGO PAHADI DAGDYA is working in right direction for the under privileged children\'s of our देवभूमि Uttarakhand..\r\n\r\nMany many thanks to our young volunteers Shri Tejram Sharma ji and Shri KRohit Sundriyal ji who has always given their valuable time to our NGO.\r\n\r\n&nbsp;\r\n\r\nOur 2 teams of पहाड़ी दगड़या were at Uttarakhand for the last 2 days distributing study materials in cash or kinds..Total no. of 11 underprivileged children\'s were supported by Pahadi Dagdya..\r\n\r\nShri&nbsp;<a class=\"profileLink\" href=\"https://www.facebook.com/akhilesh.nauriyal?fref=mentions\" data-hovercard=\"/ajax/hovercard/user.php?id=100000001540929&amp;extragetparams=%7B%22fref%22%3A%22mentions%22%7D\" data-hovercard-prefer-more-content-show=\"1\">Akhilesh Nauriyal</a>&nbsp;ji and Shri&nbsp;<a class=\"profileLink\" href=\"https://www.facebook.com/deepesh.uniyal?fref=mentions\" data-hovercard=\"/ajax/hovercard/user.php?id=1067492093&amp;extragetparams=%7B%22fref%22%3A%22mentions%22%7D\" data-hovercard-prefer-more-content-show=\"1\">Deepesh Uniyal</a>&nbsp;ji went to the School in Kaljikhal, Uttarakhand where they were received by enthusiastic school children\'s..\r\n\r\nFor this I would also like to thank Shri Kapil Dobhal ji for his continuous support..<span class=\"text_exposed_show\">\r\nजय भारत, जय उत्तराखंड</span>\r\n\r\n[ngg_images source=\"galleries\" container_ids=\"66\" display_type=\"photocrati-nextgen_basic_thumbnails\" override_thumbnail_settings=\"1\" thumbnail_width=\"240\" thumbnail_height=\"180\" thumbnail_crop=\"1\" images_per_page=\"10\" number_of_columns=\"0\" ajax_pagination=\"1\" show_all_in_lightbox=\"0\" use_imagebrowser_effect=\"1\" show_slideshow_link=\"1\" slideshow_link_text=\"Pahadi Dagdya at UK 2017\" template=\"default\" slug=\"P_D_at_UK_2017\" order_by=\"sortorder\" order_direction=\"DESC\" returns=\"included\" maximum_entity_count=\"500\"]&nbsp;','Pahadi Dagdya working for privileged children of our देवभूमि Uttarakhand','','publish','closed','closed','','pahadi-dagdya-working-for-privileged-children-of-our-%e0%a4%a6%e0%a5%87%e0%a4%b5%e0%a4%ad%e0%a5%82%e0%a4%ae%e0%a4%bf-uttarakhand','','','2017-10-