ere supported by Pahadi Dagdya..\r\n\r\nShri&nbsp;<a class=\"profileLink\" href=\"https://www.facebook.com/akhilesh.nauriyal?fref=mentions\" data-hovercard=\"/ajax/hovercard/user.php?id=100000001540929&amp;extragetparams=%7B%22fref%22%3A%22mentions%22%7D\" data-hovercard-prefer-more-content-show=\"1\">Akhilesh Nauriyal</a>&nbsp;ji and Shri&nbsp;<a class=\"profileLink\" href=\"https://www.facebook.com/deepesh.uniyal?fref=mentions\" data-hovercard=\"/ajax/hovercard/user.php?id=1067492093&amp;extragetparams=%7B%22fref%22%3A%22mentions%22%7D\" data-hovercard-prefer-more-content-show=\"1\">Deepesh Uniyal</a>&nbsp;ji went to the School in Kaljikhal, Uttarakhand where they were received by enthusiastic school children\'s..\r\n\r\nFor this I would also like to thank Shri Kapil Dobhal ji for his continuous support..<span class=\"text_exposed_show\">\r\nजय भारत, जय उत्तराखंड</span>\r\n\r\n[ngg_images source=\"galleries\" container_ids=\"66\" display_type=\"photocrati-nextgen_basic_thumbnails\" override_thumbnail_settings=\"1\" thumbnail_width=\"240\" thumbnail_height=\"180\" thumbnail_crop=\"1\" images_per_page=\"10\" number_of_columns=\"0\" ajax_pagination=\"1\" show_all_in_lightbox=\"0\" use_imagebrowser_effect=\"1\" show_slideshow_link=\"1\" slideshow_link_text=\"Pahadi Dagdya at UK 2017\" template=\"default\" slug=\"P_D_at_UK_2017\" order_by=\"sortorder\" order_direction=\"DESC\" returns=\"included\" maximum_entity_count=\"500\"]&nbsp;','Pahadi Dagdya working for privileged children of our देवभूमि Uttarakhand','','inherit','closed','closed','','1253-revision-v1','','','2017-10-26 08:19:31','2017-10-26 02:49:31','',1253,'http://pahadidagdya.com/?p=1325',0,'revision','',0),(1327,1,'2017-11-19 12:03:33','0000-00-00 00:00:00','eyJpZF9maWVsZCI6IklEIiwiX19kZWZhdWx0c19zZXQiOnRydWV9','Untitled ngg_gallery','','draft','closed','closed','','mixin_nextgen_table_extras','','','2017-11-19 12:03:33','0000-00-00 00:00:00','eyJpZF9maWVsZCI6IklEIiwiX19kZWZhdWx0c19zZXQiOnRydWV9',0,'http://